package sys.math;

import sys.math.numbertypes.SuperNumber;

public class SuperNumberConstants
{
	private SuperNumberConstants(){}
	// Contains GoldenRatio, Pi, E, EulerGamma, DegreesInRadian, RadiansInDegree
	/**
	 * The first 1000 digits of Golden Ratio
	 */
	private static final String String_GoldenRatio = "1.";
	/**
	 * The first 1000 digits of Pi
	 */
	private static final String String_Pi= "3.";
	/**
	 * The first 1000 digits of E, Euler's constant
	 */
	private static final String String_E = "2.";
	/**
	 * The first 1000 digits of Euler's Gamma, Euler-Mascheroni constant
	 */
	private static final String String_EulerGamma = "0.";
	/**
	 * The first 1000 digits of the number of Degrees in one Radian
	 */
	private static final String String_DegreesInRadian = "57.";
	/**
	 * The first 1000 digits of the number of Radians in one Degree
	 */
	private static final String String_RadiansInDegree = "0.";
	
	/**
	 * Math constant Golden Ratio<br>
	 * The value of <code>(1+sqrt(5))/2</code>
	 */
	public static final SuperNumber GoldenRatio = new SuperNumber(String_GoldenRatio);
	/**
	 * Math constant Pi<br>
	 * Cirle's circumference divided by its diameter.
	 */
	public static final SuperNumber Pi= new SuperNumber(String_Pi);
	/**
	 * Math constant E<br>
	 * The base of the natural logarithm (see {@link SuperNumber#ln()}).
	 * Also known as Euler's constant or Napier's constant.
	 */
	public static final SuperNumber E = new SuperNumber(String_E);
	/**
	 * Math constant Euler Gamma<br>
	 * The Euler-Mascheroni constant
	 */
	public static final SuperNumber EulerGamma = new SuperNumber(String_EulerGamma);
	/**
	 * The number of Degrees in one Radian<br>
	 * The value of <code>180/Pi</code>
	 */
	public static final SuperNumber DegreesInRadian = new SuperNumber(String_DegreesInRadian);
	/**
	 * The number of Radians in one Degree<br>
	 * The value of <code>Pi/180</code>
	 */
	public static final SuperNumber RadiansInDegree = new SuperNumber(String_RadiansInDegree);
}
